import React, { useState } from 'react';
import * as C from './styles';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser, faCalendarDays, faWallet, faClock } from '@fortawesome/free-solid-svg-icons';
import { useCalendarContext } from '../../context/DataContext';

const TaskWeekly = () => {
    const [currentIndex, setCurrentIndex] = useState(0);
    const { listDataSelecionada } = useCalendarContext();


    return (
        <C.weeklyContainer>
            <C.buttonContainer>
                <FontAwesomeIcon icon={faWallet} />
            </C.buttonContainer>

            <C.buttonContainer>
                <FontAwesomeIcon icon={faChevronRight} />
            </C.buttonContainer>
        </C.weeklyContainer>
    )
}

export default TaskWeekly
